import React from 'react';
import { Button as MuiButton } from '@mui/material';
import styles from './styles/Button.module.css';

const CustomButton = ({ children, variant, color, onClick, className, ...props }) => {
  const buttonClass = `${styles.button} ${variant === 'outlined' ? styles.buttonSecondary : styles.buttonPrimary}`;

  return (
    <MuiButton 
      className={`${buttonClass} ${className}`} 
      onClick={onClick} 
      {...props}
    >
      {children}
    </MuiButton>
  );
};

export default CustomButton;
